/*** Calculate ***/
void test_calculate_1(void)
{
    /*** Calculate (Configuration NULL) ***/
    /* Variable */
    uint8_t data[1];

    /* Calculate */
    TEST_ASSERT_EQUAL_HEX16(0x0000, crc16_calculate(NULL, data, sizeof(data)));
}

void test_calculate_2(void)
{
    /*** Calculate (Data NULL) ***/
    /* Variable */
    crc16_configuration_t configuration;
    uint8_t data[1];

    /* Calculate */
    TEST_ASSERT_EQUAL_HEX16(0x0000, crc16_calculate(&configuration, NULL, sizeof(data)));
}

